/*建立資料庫*/
CREATE DATABASE homework;
/*新增顧客資料表*/
CREATE TABLE `homework`.`custom` ( `cid` VARCHAR(10) NOT NULL , `cname` VARCHAR(40) NOT NULL , `c_pic` BLOB NULL , PRIMARY KEY (`cid`)) ENGINE = InnoDB;
/*新增訂單表*/
CREATE TABLE `homework`.`transaction` ( `tid` VARCHAR(10) NOT NULL , `cid` VARCHAR(10) NOT NULL , `date_time` DATETIME NOT NULL , PRIMARY KEY (`tid`)) ENGINE = InnoDB;
/*新增訂單明細表*/
CREATE TABLE `homework`.`detail` ( `did` VARCHAR(10) NOT NULL , `tid` VARCHAR(10) NOT NULL , `pid` int NOT NULL , `amount` int NOT NULL , PRIMARY KEY (`did`)) ENGINE = InnoDB;
/*新增產品資料表*/
CREATE TABLE `homework`.`product` ( `pid` INT NOT NULL , `pname` VARCHAR(60) NOT NULL , `p_pic` BLOB NULL , PRIMARY KEY (`pid`)) ENGINE = InnoDB;

